It’s not just red and white ♥️🤍 Singapore’s cityscape is adorned with a dazzling array of colours, day and night 🌈 #TeamAscott pays homage to our roots in Singapore, who turns 55 today 🎉🇸🇬! As we take this opportunity to remind ourselves that there is truly no place like home, we invite you, no matter where you are in the world, to reignite your passion for travel and discovery as a #touristinyourowncity.

Be inspired by how #SingapoRediscovers the beauty of home through exciting #staycation adventures: 

📸 Capture the vibrant colours and enchanting stories of home
🕵🏻 Learn from passionate and savvy local guides like @monsterdaytours and @tribetours
🧖🏻‍ Wind down after an adventure-filled day with a rejuvenating staycation 

Keep safe as you #ExploreSingapore – stay hydrated & don’t forget to mask up! 😷

Embark on your #SingapoRediscovers staycation adventure with us: swipe up in our IG stories or visit https://bit.ly/HBDSGIGORENCTA20200809 for more inspiration! 

#Ascott #lyfbyascott #SingaporeStaycation #StaycationSG #SingaPoliday #ndp2020 #sg55 @capitaland

